type Props = Partial<CustomIconComponentProps> & {
  type: number;
  isBigIcon?: boolean;
}

export const NumberIcon = (props: Props) => {
  const { type, style, isBigIcon, ...otherProps } = props

  const bigIcons: Record<Props['type'], FC> = {
    1: Big_1_Svg,
    2: Big_2_Svg,
    3: Big_3_Svg,
    4: Big_4_Svg,
    5: Big_5_Svg,
    6: Big_6_Svg,
  }

  const smallIcons: Record<Props['type'], FC> = {
    1: Small_1_Svg,
    2: Small_2_Svg,
    3: Small_3_Svg,
    4: Small_4_Svg,
    5: Small_5_Svg,
    6: Small_6_Svg,
  }

  return (
    <Icon
      style={ { ...style } }
      component={
        isBigIcon ?
          bigIcons[type] :
          smallIcons[type]
      }
      { ...otherProps }
    />
  )
};
